import WelcomeHomePage from './WelcomeHomePage'

class CookYStories extends Component {
    render() {
        return (
                <Router>
                <>
                    <HeaderComponent/>
                    <WelcomeHomePage/>
                </>
                </Router> 
        );
    }
}



export default CookYStories;
